Mark Watches *Supernatural*, Season 01
----------------------------

Commissioned by his fans to watch Eric Kripke's epic, tragicomical tale of two brothers who criss-cross the US hunting monsters, Mark Oshiro (of Mark Watches, Mark Reads, and Mark Does Stuff fame) takes on the first season of the 2005 television series, almost entirely unspoiled. And he is not prepared.

The videos contained herein are of Mark watching and reacting to the series, *not* the actual episodes of season one of *Supernatural*.


Reviews written by Mark after watching each episode can be found here:  &lt;a href=&quot;
http://markwatches.net/reviews/category/supernatural/?order=asc&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://markwatches.net/reviews/category/supernatural/?order=asc&lt;/a&gt;


All files are in Apple's QuickTime format, and vary in size from 212 MB to 547 MB, and in length from 40:14 to 46:46.

